import { __decorate } from "tslib";
import { Component } from '@angular/core';
let FindFriendsPageComponent = class FindFriendsPageComponent {
    constructor(findFriendsService) {
        this.findFriendsService = findFriendsService;
    }
    async ngOnInit() {
        this.dogs = await this.findFriendsService.getDogs();
    }
};
FindFriendsPageComponent = __decorate([
    Component({
        selector: 'app-find-friends-component',
